    public class BookLight
    {
        public static readonly Dictionary<int, byte> Positions = new Dictionary<int, byte>();

        public static bool use_book = true;

        public static void InitBook()
        {
            byte[] data = WeightLight.Decode(Data.BOOK_DATA);

            for(int i = 0; i < data.Length / 5; i++)
            {
                byte move = data[i * 5];
                int hash = (data[i * 5 + 4] << 24) | (data[i * 5 + 3] << 16) | (data[i * 5 + 2] << 8) | data[i * 5 + 1];
                Positions[hash] = move;
            }
        }

        public static ulong SearchBook(B board)
        {
            if (!use_book)
                return 0;

            var rotated = board;

            for (int i = 0; i < 2; i++)
            {
                for (int j = 0; j < 4; j++)
                {
                    int hash = rotated.GetHashCode();

                    if (Positions.ContainsKey(hash))
                    {
                        ulong move = 1UL << Positions[hash];

                        for (int k = 0; k < 4 - j; k++)
                            move = B.Rotate90(move);

                        if (i == 1)
                            move = B.HorizontalMirror(move);

                        return move;
                    }
                    rotated = rotated.Rotated90();
                }
                rotated = board.HorizontalMirrored();
            }
            return 0;
        }
    }

    public static class WeightLight
    {
        static Stopwatch timer = new Stopwatch();

        public static byte[] Decode(string encoded)
        {
            byte[] data = Encoding.UTF8.GetBytes(encoded);

            byte[] decoded = new byte[data.Length / 3 / 8 * 15];

            for (int i = 0; i < data.Length / 8 / 3; i++)
            {
                int[] p = new int[8];

                for (int j = 0; j < 8; j++)
                {
                    p[j] = Decode(data, i * 24 + j * 3);
                }
                DecodeBlock(p, decoded, i * 15);
            }

            return decoded;
        }

        public static void DecodeBlock(int[] p, byte[] dst, int o)
        {
            static int Mask(int i)
            {
                return (1 << i) - 1;
            }

            for (int i = 0; i < 7; i++)
            {
                dst[o + i * 2] = (byte)((p[i] >> i) & 0xFF);

                int b1 = (p[i + 1] & Mask(i + 1)) << (7 - i);
                int b2 = (p[i] >> (8 + i)) & Mask(7 - i);
                dst[o + i * 2 + 1] = (byte)(b1 | b2);
            }
            dst[o + 14] = (byte)((p[7] >> 7) & 0xFF);
        }

        public static int Decode(byte[] src, int offset)
        {
            byte b1 = src[offset];
            byte b2 = src[offset + 1];
            byte b3 = src[offset + 2];

            int i = ((b1 & 0xF) << 12) | ((b2 & 0b111111) << 6) | (b3 & 0b111111);

            if (i >= 0xB000)
                i -= 0x1000;

            i -= 0x4000;

            return i;
        }

